    body: '### Features\r\n\r\n* **useSwipe:** new function ([#333](https://github.com/vueuse/vueuse/issues/333)) ([f11364a](https://github.com/vueuse/vueuse/commit/f11364a))\r\n\r\n\r\n### BREAKING CHANGES\r\n\r\n* **useWebSocket**: rework useWebSocket (#326) ([4013107](https://github.com/vueuse/vueuse/commit/4013107)), closes [#326](https://github.com/vueuse/vueuse/issues/326)\r\n  - the `ws` option in the return of `useWebSocket` is not a ref instead of plain WebSocket instance\r\n  - `useWebSocket`\'s `send` will now buffers data before the connection established instead of discarding sliently\r\n  - `useWebSocket`\'s returned `state` is renamed to `status`\r\n* Switch from umd to iife build for CDN, fix #329 ([8f76f3a](https://github.com/vueuse/vueuse/commit/8f76f3a)), closes [#329](https://github.com/vueuse/vueuse/issues/329)\r\n  - CDN build switched from `umd` to `iife`. Then entry renamed from `dist/index.umd.js` to `dist/index.iife.js`.\r\n  - The global names of packages are now extend on `VueUse`. `VueUseShared`, `VueUseFirebase` is no longer appliable.\r\n  - `vue-demi` is now inlined with CDN build.\r\n  - CDN usage is now like:\r\n\r\n```html\r\n<script src="https://unpkg.com/@vueuse/shared"></script>\r\n<script src="https://unpkg.com/@vueuse/core"></script>\r\n```\r\n\r\n### Bug Fixes\r\n\r\n* **useEventListener:** cleanup types, close [#338](https://github.com/vueuse/vueuse/issues/338) ([ed93b78](https://github.com/vueuse/vueuse/commit/ed93b78))\r\n\r\n\r\n\r\n',
