    zipball_url: 'https://api.github.com/repos/vueuse/vueuse/zipball/v4.0.0',
    body: '# \r\n\r\n## Thanks!\r\n\r\n@neelance @matias-capeletto @maxma241 @scottbedard\r\n@DarkXanteR @anteriovieira @amrbashir @liaoliao666 \r\n@yangger6 @Demivan @iGalaxyz @sxzz @sibbng @Ericteen\r\n\r\n## New Features\r\n\r\n- 13 new functions `pausableWatch`, `debouncedWatch`, etc.\r\n- New [@vueuse/router](http://npmjs.com/package/@vueuse/router) package.\r\n- Reviewed every function and refactored with more consistent and flexible APIs.\r\n- [New Guide docs](https://vueuse.js.org/?path=/story/docs--guide).\r\n- [Event filter system](https://vueuse.js.org/?path=/story/docs--guide).\r\n- [Bundle size report for each function](https://github.com/antfu/vueuse/blob/master/docs/Export-Size.md)\r\n- Fulfilled JS Docs.\r\n- Isomorphic unit-test for Vue 2 and 3.\r\n- Configurable global dependencies `window`, `document`, etc.\r\n- `isSupported` for browsers compatibility check.\r\n- Demo rewrites by @anteriovieira.\r\n\r\n## Migration Guide\r\n\r\n### BREAKING CHANGE\r\n\r\n<details>\r\n<summary>\r\n<b><code>useTransition</code></b> - named transition presets are removed. Import them from <code>TransitionPresets</code> instead. #190 \r\n</summary>\r\n\r\n<br>\r\n\r\n```ts\r\nimport { useTransition } from \'@vueuse/core\'\r\n\r\nuseTransition(baseNumber, {\r\n  duration: 1000,\r\n  transition: \'easeInOutCubic\',\r\n})\r\n```\r\n\r\nChanged to\r\n \r\n```ts\r\nimport { useTransition, TransitionPresets } from \'@vueuse/core\'\r\n\r\nuseTransition(baseNumber, {\r\n  duration: 1000,\r\n  transition: TransitionPresets.easeInOutCubic,\r\n})\r\n```\r\n</details>\r\n\r\n<details>\r\n<summary>\r\n<b><code>asyncComputed</code></b> - evaluating state is now passed through arguments instead of returning tuple\r\n</summary>\r\n\r\n<br>\r\n\r\n```ts\r\nimport { asyncComputed } from \'@vueuse/core\'\r\n\r\nconst [state, evaluating] = asyncComputed(async () => {}, {})\r\n```\r\n\r\nChanged to\r\n \r\n```ts\r\nimport { asyncComputed } from \'@vueuse/core\'\r\n\r\nconst evaluating = ref(false)\r\nconst state = asyncComputed(async () => {}, {}, evaluating)\r\n```\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><code>useEventListener</code></b> - event target moved from 4th argument to first\r\n</summary>\r\n\r\n<br>\r\n\r\n```ts\r\nimport { useEventListener } from \'@vueuse/core\'\r\n\r\nuseEventListener(\'click\', handler, undefined, document)\r\n```\r\n\r\nChanged to\r\n \r\n```ts\r\nimport { useEventListener } from \'@vueuse/core\'\r\n\r\nuseEventListener(document, \'click\', handler)\r\n```\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><code>useRefHistory</code></b> - `flush` now default to `pre`, returned `current` renamed to `source`, hisotry point `value` renamed to `snapshot`\r\n</summary>\r\n\r\n<br>\r\nRefer to docs for more details.\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><code>useWebWorkerFn</code></b> - `workerStatus` changed from enum to literal unions\r\n</summary>\r\n\r\n<br>\r\n\r\n```ts\r\nimport { useWebWorkerFn, WorkStatus } from \'@vueuse/core\'\r\n\r\nconst { workerStatus } = useWebWorkerFn(fn)\r\n\r\nworkerStatus.value === WorkStatus.running\r\n```\r\n\r\nChanged to\r\n \r\n```ts\r\nimport { useWebWorkerFn } from \'@vueuse/core\'\r\n\r\nconst { workerStatus } = useWebWorkerFn(fn)\r\n\r\nworkerStatus.value === \'RUNNING\'\r\n```\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><del><code>useNow</code></del></b> - `useNow` renamed to `useTimestamp` with API changes\r\n</summary>\r\n\r\n<br>\r\n\r\n```ts\r\nimport { useNow } from \'@vueuse/core\'\r\n\r\nconst now = useNow()\r\n```\r\n\r\nChanged to\r\n \r\n```ts\r\nimport { useTimestamp } from \'@vueuse/core\'\r\n\r\nconst { timestamp: now, pause, resume } = useTimestamp()\r\n```\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><del><code>useRaf</code></del></b> - dropped in favor of `useTimestamp`\r\n</summary>\r\n\r\n<br>\r\nNone\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><code>useTimeout / useInterval</code></b> - returned `activated` renamed to `isActive`\r\n</summary>\r\n\r\n<br>\r\nNone\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><code>useRafFn</code></b> - `start` / `stop` renamed to `resume` / `pause`\r\n</summary>\r\n\r\n<br>\r\nNone\r\n</details>\r\n\r\n\r\n<details>\r\n<summary>\r\n<b><code>useXXXObserver</code></b> - API changes\r\n</summary>\r\n<br>\r\n\r\nRefer to docs and types for more details.\r\n</details>\r\n\r\n<details>\r\n<summary>Generated changelog</summary>\r\n\r\n### Bug Fixes\r\n\r\n* **typo:** usCounter -> useCounter ([#212](https://github.com/antfu/vueuse/issues/212)) ([b75fe5d](https://github.com/antfu/vueuse/commit/b75fe5d))\r\n* **useDebounceFn:** types ([ad55f48](https://github.com/antfu/vueuse/commit/ad55f48))\r\n* **useMouseInElement:** crash in firefox ([8175ecc](https://github.com/antfu/vueuse/commit/8175ecc))\r\n* **useStorage:** types, close [#197](https://github.com/antfu/vueuse/issues/197), close [#198](https://github.com/antfu/vueuse/issues/198) ([b32ff40](https://github.com/antfu/vueuse/commit/b32ff40))\r\n* **vueuse/router:** improve api flexibility ([a3d03e9](https://github.com/antfu/vueuse/commit/a3d03e9))\r\n* prepare scripts ([9d057fb](https://github.com/antfu/vueuse/commit/9d057fb))\r\n\r\n\r\n### Features\r\n\r\n* **ignorableWatch:** new function ([#209](https://github.com/antfu/vueuse/issues/209)) ([ae5dd48](https://github.com/antfu/vueuse/commit/ae5dd48))\r\n* **useShare:** adds isSupported ([#180](https://github.com/antfu/vueuse/issues/180)) ([882ece0](https://github.com/antfu/vueuse/commit/882ece0))\r\n* **useStorage:** support eventFilter and more options ([b7fe7f5](https://github.com/antfu/vueuse/commit/b7fe7f5))\r\n* **useTimeoutFn:** added startRightNow ([#195](https://github.com/antfu/vueuse/issues/195)) ([fe057e5](https://github.com/antfu/vueuse/commit/fe057e5))\r\n* **useVModel:** new function useVModel ([9aa2c3a](https://github.com/antfu/vueuse/commit/9aa2c3a))\r\n* **vueuse/router:** new package [@vueuse](https://github.com/vueuse)/router ([1005237](https://github.com/antfu/vueuse/commit/1005237))\r\n* **watchWithFilter:** 4 new watch utilities ([#200](https://github.com/antfu/vueuse/issues/200)) ([31edda8](https://github.com/antfu/vueuse/commit/31edda8))\r\n* event filters ([#194](https://github.com/antfu/vueuse/issues/194)) ([c59a30c](https://github.com/antfu/vueuse/commit/c59a30c))\r\n\r\n</details>\r\n\r\n',
